import React from 'react';
import { motion } from 'framer-motion';
interface Navbar {
    darkMode: boolean;
    handleScroll: (target: React.MutableRefObject<HTMLElement>) => void;
    isScrolled?: boolean;
}

export default function Navbar(props:Navbar) {
    const {darkMode, handleScroll} = props;


    return (
        <ul className={`navbar ${darkMode && "dark"}`}>
            <li>
                <a className="nav-item" onClick={handleScroll()}>about</a>
            </li>
            <li>
                <a className="nav-item" onClick={handleScroll()}>experience / projects</a>
            </li>
            <li>
                <a className="nav-item" onClick={handleScroll()}>contact</a>
            </li>
        </ul>
    )
}
